export const People = [
	{
		name: 'John Smith',
		birthmonth: 'January',
		birthday: '5',
		birthyear: '1980',
	},
	{
		name: 'Jennifer Goran',
		birthmonth: 'July',
		birthday: '4',
		birthyear: '1992',
	},
	{
		name: 'Peter Miller',
		birthmonth: 'April',
		birthday: '16',
		birthyear: '1978',
	},
	{
		name: 'Shannon Jenkins',
		birthmonth: 'August',
		birthday: '9',
		birthyear: '1954',
	},
];

console.log();

console.log(new Date('January 5').getMonth().getDate());
//=== new Date())
//console.log(People.birthday);
console.log(People.filter((person) => person.birthday === new Date()));
